import MainHome from "./Component/MainHome";

const styles = {

    homepage: {
        height: "10vh",
        width: "75vh",
        textAlign: "center",
    }
}
function HomePage() {
    return (
        <div className="hero">
        <div className="main_homepage">
            <TopBanner/>
            <MainHome/>
        </div>
        </div>
    )
}

export default HomePage;
